import React from 'react'
import './DogBar.css'; 

function dogExample (dog) {
    return <span onClick={() => props.changeTheName}>{dog.name}</span>
}

// ^ this is another way we can factor out 
function DogBar (props) {
    return (
        <div className="dog-bar">
            { props.dogs.map( dogExample ) }
        </div>
    )
}

export default DogBar
